column8:
高さが低く、椅子の下やテーブルの下に入り、<BR>
置き場所を取らず、存在が気にならない収納用品です。<BR>
本体（袋部分）はナイロンで出来ている<BR>
ので中の物が見えず、見た目がすっきりします。<BR>洗濯も可能です。<BR><BR>
業務用店舗用品として開発された品で<BR>
本来の用途は手荷物入れです。<BR><BR>
レストラン、歯科、エステサロンなどでご利用いただいております。<BR>

使わない時は折たたみ可能<BR>
サイズ：よこ37×高さ27(袋部分20)×奥行き26cm<BR>
素材：本体/ナイロン100％　フレーム/スチール(クロームメッキ)<BR>
