<font size="2">
コの字型のスマートなフォルムの『Bew テーブルラック』です。

フックの部分をテーブルの天板に引っ掛けることで散らかりがちな新聞や雑誌の整理整頓ができます。
普段使うことのないテーブル下のスペースを有効活用したい方にもオススメです。
デスク上や床に直接置いて使ったり、棚に引っ掛けて収納ケースとして使ったり、シーンによっていろいろな使い方ができるのもポイントです。  

また、移動する際はフックの部分を持ち手として簡単に持ち歩くことができます。

シンプルで無駄のないスマートなデザインがどんなインテリアとも相性抜群。
本体はメラミン焼き付け塗装がされていて、シンプルな中にも品質の高さを感じる仕上がりになっています。

そして、お好みの長さにカットして使える、筒型の滑り止め付き。気になるテーブルのキズの防止になります。








